import React from 'react';
import { connect } from 'react-redux';
import { Link } from 'react-router-dom';
import { Container, Grid } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';

import Button from '../components/Button';

import { getLaunches, getRockets } from '../fetch/getter';

import { addToCounter, subtractFromCounter } from '../redux/actions/counter';

const useStyles = makeStyles({
  container: {
    margin: '50px',
    backgroundColor: 'E1E1E1'
  },
  title: {
    marginBottom: '50px'
  }
});

const HomePage = ({ count, incrementCount, decrementCount }) => {

  const classes = useStyles();

  return (
    <React.Fragment>
      <Container className={classes.container}>
        <Grid container direction="row">
          <Grid item align="left" xs={12} sm={12} md={8} lg={8}>
            <h1 className={classes.title}>SpaceX Rockets</h1>
          </Grid>
          <Grid item align="left" xs={12} sm={2} md={2} lg={2}>
            Search
          </Grid>
        </Grid>
          <Button
            onClick={() => {
              incrementCount();
            }}
            title="Increment Count"
          />
          <Button
            onClick={() => {
              decrementCount();
            }}
            title="Decrement Count"
          />
          <Button
            onClick={() => {
              getLaunches();
            }}
            title="Get Launches"
          />
          <Button
            onClick={() => {
              getRockets();
            }}
            title="Get Rockets"
          />
          Your current count is {count}
        <Link
          to="/test"
        >
        To Test Page
        </Link>
        </Container>
    </React.Fragment>
  )
}

const mapStateToProp = (state) => {
  const { counter } = state;
  return {
    count: counter.count,
  };
};

const mapDispatchToProps = (dispatch) => {
  return {
    incrementCount: () => {
      dispatch(addToCounter());
    },
    decrementCount: () => {
      dispatch(subtractFromCounter());
    },
  }
}

export default connect(mapStateToProp, mapDispatchToProps)(HomePage);
